levels = [tutorialv1, tutorialv2, grittedstrings, sostressedeasy, sostressedhard, publicocautivoeasy, publicocautivohard, coderemix, iloveyouvbseasy, iloveyouvbshard, lawrenceeasy, lawrencehard, terrabyteconnection];
