//canvas properties
const c = document.getElementById("displayCanvas");
const ctx = c.getContext("2d");
cwidth = ctx.canvas.width;
cheight = ctx.canvas.height;
const centerX = cwidth/2;
const centerY = cheight/2;
// images
const block = new Image();
const hold = new Image();
const side = new Image();
const mine = new Image();
const mineHold = new Image();
const inverse = new Image();
const ringcw = new Image();
const ringccw = new Image();
const slice = new Image();

block.src = 'beats/square.png';
hold.src = 'beat/hold.png';
side.src = 'beat/side.png';
mine.src = 'beat/mine.png';
mineHold.src = 'beat/minehold.png';
inverse.src = 'beat/inverse.png';
ringcw.src = 'beat/ringcw.png';
ringccw.src = 'beat/ringccw.png';
slice.src = 'beat/slice.png';

const notetap = new Image();
notetap.src = 'beat/notetap.png'

const cranky = new Image();
cranky.src = 'https://beatblock.wiki.gg/images/6/64/Circle.png';

ctx.font = "48px disco";
ctx.strokeStyle = 'black';
let loadedImages = 0;
const images = [block, hold, side, mine, mineHold, inverse, ringcw, ringccw, slice, cranky];

let score = 0

let chart = [];
let chartEnd = 100;
let chartName = "";
let level = [];
let manifest = [];
// const chartObj = JSON.parse(chart);

let speed = 100;
const imgSzMultiplier = 2;
let intime = -5;
ctx.fillStyle = "grey"

changeChart()

function animate() {
  drawGrid();
  drawImages();
  drawAbove();
  requestAnimationFrame(animate);
}

function updateScore(form) {
  levelguessed = form.elements[0].value;
  guessedbeat = form.elements[1].value;
  distance = Math.abs(intime - guessedbeat);

  if (levelguessed === chartName) {
    score = score + 250;
  }

  if (distance === 0) {
    score = score + 500
  } else if (distance > 150) {
    score -= distance
  } else if (distance < 160) {
    score += Math.floor(500/distance)
  }

  changeChart()
}

function changeChart() {
  chart = levels[getRandomInt(levels.length)];
  chartName = chart[chart.length-1].name;
  chartEnd = chart[chart.length-2].time;
  intime = getRandomInt(chartEnd);
}

function drawGrid() {
  ctx.fillRect(0,0,cwidth,cheight);
  //probably never actually going to be used or wrote - cerdef first of sept 2025
}

function returnAngleName(obj) {
  if (obj.angle === undefined) {
    return obj.angle1;
  }
  return obj.angle;
}

function getEvents(chart) {
  if (Array.isArray(chart)) {
    return chart;
  } else {
    return chart.events;
  }
}

function drawImages() {
  const radiusMultiplier = 100;
  const centerX = cwidth/2;
  const centerY = cheight/2;
  for (var i = 0; i < chart.length; i++) {
    let obj = chart[i];
    if (obj.time < intime - 2 || obj.time > intime + 30) continue; // skip offscreen notes

    const dx = (obj.time - intime + 1) * speed * Math.cos((returnAngleName(obj) - 90) * (Math.PI / 180));
    const dy = (obj.time - intime + 1) * speed * Math.sin((returnAngleName(obj) - 90) * (Math.PI / 180));
    const dx2 = (obj.time + obj.duration - intime + 1) * speed * Math.cos((obj.angle2 - 90) * (Math.PI / 180));
    const dy2 = (obj.time + obj.duration - intime + 1) * speed * Math.sin((obj.angle2 - 90) * (Math.PI / 180));

    if (obj.time - intime > -1) {
      if (obj.type === "extraTap") {
        drawTaps(obj.time - intime + 1);
      } else if (obj.type === "block" || obj.type === "beat" ) {
        drawNote(block, dx, dy, obj);
      } else if (obj.type === "side") {
        drawNote(side, dx, dy, obj);
      } else if (obj.type === "mine") {
        drawNote(mine, dx, dy, obj);
      } else if (obj.type === "inverse") {
        drawNote(inverse, dx, dy, obj);
      } else if (obj.type === "slice") {
        drawNote(slice, dx, dy, obj);
      } else if (obj.type === "sliceinvert") {
        drawNote(slice, dx, dy, obj);
      } else if (obj.type === "hold") {
        drawHold(obj, dx, dy, dx2, dy2);
      } else if (obj.type === "mineHold") {
        drawHold(obj, dx, dy, dx2, dy2);
      } else if (obj.type === "ringcw") {
        drawRing(ringcw, obj.time);
      } else if (obj.type === "ringccw") {
        drawRing(ringccw, obj.time);
      }
    }
  }

  ctx.beginPath();
  ctx.arc(centerX,centerY, 96, 0, 2 * Math.PI);
  ctx.strokeStyle = "black"
  ctx.fillStyle = "white"
  ctx.lineWidth = "6"
  ctx.stroke();
  ctx.fill();
  ctx.drawImage(
    cranky, centerX-(cranky.width / 2 * imgSzMultiplier),
    centerY-(cranky.height / 2 * imgSzMultiplier),
    cranky.width * imgSzMultiplier,
    cranky.height * imgSzMultiplier
  );
}

function drawAbove() {
  ctx.fillStyle = "black"
  ctx.fillText("Score: " + score, 10, 50);
  ctx.fillStyle = "grey"
}

function drawNoteTap(x,y) {
  ctx.drawImage(
    notetap, x - (notetap.width / 2 * imgSzMultiplier * 1.5) + centerX,
    y - (notetap.height / 2 * imgSzMultiplier * 1.5) + centerY,
    notetap.width * imgSzMultiplier * 1.5,
    notetap.height * imgSzMultiplier * 1.5
  );
}

function drawNote(noteType, x, y, extraInfo) {
  ctx.drawImage(
    noteType, x - (noteType.width / 2 * imgSzMultiplier) + centerX,
    y - (noteType.height / 2 * imgSzMultiplier) + centerY,
    Math.min(noteType.width * imgSzMultiplier),
    noteType.height * imgSzMultiplier
  );
  if (extraInfo.tap) {
    drawNoteTap(x,y);
  }
}

function drawTaps(waveBeat) {
  ctx.strokeStyle = "black";
  ctx.lineWidth = 4;
  ctx.beginPath();

  const step = 22.5;
  const startX = waveBeat * speed * Math.cos(0) + centerX;
  const startY = waveBeat * speed * Math.sin(0) + centerY;
  ctx.moveTo(startX, startY);

  for (let angle = step; angle <= 360; angle += step) {
    const rad = angle * (Math.PI / 180);
    const x = waveBeat * speed * Math.cos(rad) + centerX;
    const y = waveBeat * speed * Math.sin(rad) + centerY;
    ctx.lineTo(x, y);
  }

  ctx.closePath();
  ctx.stroke();

}

function drawHold(obj, dx, dy, dx2, dy2) {
  if (obj.type === "hold") {
    drawHoldCurve("hold", centerX, centerY, dx + centerX, dy + centerY, dx2 + centerX, dy2 + centerY, returnAngleName(obj), obj.angle2, obj.holdEase);

    ctx.drawImage(
      hold, dx - (hold.width / 2 * imgSzMultiplier) + centerX,
      dy - (hold.height / 2 * imgSzMultiplier) + centerY,
      hold.width * imgSzMultiplier,
      hold.height * imgSzMultiplier
    );
    ctx.drawImage(
      hold, dx2 - (hold.width / 2 * imgSzMultiplier) + centerX,
      dy2 - (hold.height / 2 * imgSzMultiplier) + centerY,
      hold.width * imgSzMultiplier,
      hold.height * imgSzMultiplier
    );
    if (obj.tap) {
      drawNoteTap(dx,dy);
    }
    if (obj.endTap) {
      drawNoteTap(dx2,dy2);
    }
  } else {
    drawHoldCurve("mineHold", centerX, centerY, dx + centerX, dy + centerY, dx2 + centerX, dy2 + centerY, returnAngleName(obj), obj.angle2, obj.holdEase);

    ctx.drawImage(
      mineHold, dx - (mineHold.width / 2 * imgSzMultiplier) + centerX,
      dy - (mineHold.height / 2 * imgSzMultiplier) + centerY,
      mineHold.width * imgSzMultiplier,
      mineHold.height * imgSzMultiplier
    );
    ctx.drawImage(
      mineHold, dx2 - (hold.width / 2 * imgSzMultiplier) + centerX,
      dy2 - (mineHold.height / 2 * imgSzMultiplier) + centerY,
      mineHold.width * imgSzMultiplier,
      mineHold.height * imgSzMultiplier
    );
    if (obj.tap) {
      drawNoteTap(dx,dy);
    }
    if (obj.endTap) {
      drawNoteTap(dx2,dy2);
    }
  }
}

function drawHoldCurve(type, ox, oy, x, y, x2, y2, angle1, angle2, easing) {
  const len1 = Math.hypot(x - ox, y - oy);
  const len2 = Math.hypot(x2 - ox, y2 - oy);

  const segments = Math.min(48, Math.floor(Math.abs(angle2 - angle1) / 2));
  const points = [];

  const c1 = 1.70158;
  const c2 = c1 * 1.525;
  const c3 = c1 + 1;
  const c4 = (2 * Math.PI) / 3;
  const c5 = (2 * Math.PI) / 4.5;
  // easing function
  const ease = (t) => {
    switch (easing) {
      default: return t;
      case "linear": return t;
      case ("inSine" || "InSine"): return 1 - Math.cos((t * Math.PI) / 2);
      case ("outSine" || "OutSine"): return Math.sin((t * Math.PI) / 2);
      case ("inOutSine" || "InOutSine"): return -(Math.cos(Math.PI * t) - 1) / 2;
      case ("inQuad" || "InQuad"): return t * t;
      case ("outQuad" || "OutQuad"): return 1 - (1 - t) * (1 - t);
      case ("inOutQuad" || "InOutQuad"): return t < 0.5 ? 2 * t * t : 1 - Math.pow(-2 * t + 2, 2) / 2;
      case ("inCubic" || "InCubic"): return t * t * t;
      case ("outCubic" || "OutCubic"): return 1 - Math.pow(1 - t, 3);
      case ("inOutCubic" || "InOutCubic"): return t < 0.5 ? 4 * t * t * t : 1 - Math.pow(-2 * t + 2, 3) / 2;
      case ("inQuart" || "InQuart"): return t * t * t * t;
      case ("outQuart" || "OutQuart"): return 1 - Math.pow(1 - t, 4);
      case ("inOutQuart" || "InOutQuart"): return t < 0.5 ? 8 * t * t * t * t : 1 - Math.pow(-2 * t + 2, 4) / 2;
      case ("inQuint" || "InQuint"): return t * t * t * t * t;
      case ("outQuint" || "OutQuint"): return 1 - Math.pow(1 - t, 5);
      case ("inOutQuint" || "InOutQuint"): return t < 0.5 ? 16 * t * t * t * t * t : 1 - Math.pow(-2 * t + 2, 5) / 2;
      case ("inExpo" || "InExpo"): return t === 0 ? 0 : Math.pow(2, 10 * t - 10);
      case ("outExpo" || "OutExpo"): return t === 1 ? 1 : 1 - Math.pow(2, -10 * t);
      case ("inOutExpo" || "InOutExpo"): return t === 0
        ? 0
        : t === 1
        ? 1
        : t < 0.5 ? Math.pow(2, 20 * t - 10) / 2
        : (2 - Math.pow(2, -20 * t + 10)) / 2;
      case ("inCirc" || "InCirc"): return 1 - Math.sqrt(1 - Math.pow(t, 2));
      case ("outCirc" || "OutCirc"): return Math.sqrt(1 - Math.pow(t - 1, 2));
      case ("inOutCirc" || "InOutCirc"): return t < 0.5
        ? (1 - Math.sqrt(1 - Math.pow(2 * t, 2))) / 2
        : (Math.sqrt(1 - Math.pow(-2 * t + 2, 2)) + 1) / 2;
      case ("inElastic" || "InElastic"): return t === 0
        ? 0
        : t === 1
        ? 1
        : -Math.pow(2, 10 * t - 10) * Math.sin((t * 10 - 10.75) * c4);
      case ("outElastic" || "OutElastic"): return t === 0
        ? 0
        : t === 1
        ? 1
        : Math.pow(2, -10 * t) * Math.sin((t * 10 - 0.75) * c4) + 1;
      case ("inOutElastic" || "InOutElastic"): return t === 0
        ? 0
        : t === 1
        ? 1
        : t < 0.5
        ? -(Math.pow(2, 20 * t - 10) * Math.sin((20 * t - 11.125) * c5)) / 2
        : (Math.pow(2, -20 * t + 10) * Math.sin((20 * t - 11.125) * c5)) / 2 + 1;
      case ("inBack" || "InBack"): return c3 * t * t * t - c1 * t * t;
      case ("outBack" || "OutBack"): return 1 + c3 * Math.pow(t - 1, 3) + c1 * Math.pow(t - 1, 2);
      case ("inOutBack" || "InOutBack"): return t < 0.5
        ? (Math.pow(2 * t, 2) * ((c2 + 1) * 2 * t - c2)) / 2
        : (Math.pow(2 * t - 2, 2) * ((c2 + 1) * (t * 2 - 2) + c2) + 2) / 2;
    }
  };

  for (let i = 0; i <= segments; i++) {
    const t = i / segments;
    const easedT = ease(t);

    let nextAngle = lerp(angle1, angle2, easedT);
    nextAngle = (nextAngle - 90) * Math.PI / 180;

    const nextDistance = lerp(len1, len2, t);
    const px = ox + Math.cos(nextAngle) * nextDistance;
    const py = oy + Math.sin(nextAngle) * nextDistance;

    points.push([px, py]);
  }

  // draw curve
  if (points.length >= 2) {
    ctx.beginPath();
    ctx.moveTo(points[0][0], points[0][1]);
    for (let i = 1; i < points.length; i++) {
      ctx.lineTo(points[i][0], points[i][1]);
    }

    if (type === "hold") {
      ctx.strokeStyle = "black"; ctx.lineWidth = 32; ctx.stroke();
      ctx.strokeStyle = "white"; ctx.lineWidth = 26; ctx.stroke();
    } else if (type === "mineHold") {
      ctx.strokeStyle = "black"; ctx.lineWidth = 32; ctx.stroke();
      ctx.strokeStyle = "white"; ctx.lineWidth = 28; ctx.stroke();
      ctx.strokeStyle = "black"; ctx.lineWidth = 24; ctx.stroke();
    }
  }
}

function drawRing(type, beat) {
  ctx.drawImage(
    type, centerX - (type.width * (3 * (beat-intime)+3))/2,
    centerY - (type.height * (3 * (beat-intime)+3))/2,
    type.width * (3 * (beat-intime)+3),
    type.height * (3 * (beat-intime)+3)
  );
}


// simple linear interpolation
function lerp(a, b, t) {
  return a + (b - a) * t;
}


function getRandomInt(max) {
  return Math.floor(Math.random() * max);
}

animate();




